import React from 'react';
import '../../App.css';

export default class SignUp extends React.Component {

  render() {
  return (
  <div className='sign-up'>
    <form>
      <input type='text' class="form-control" placeholder="First name" aria-label="First name"/>
    </form>
  </div>
  );
}
}
